import React, { useState } from 'react';
import PropTypes from 'prop-types';

const DisplayPrompts = ({usedPrompts, model, variables}) => {
  console.log(usedPrompts);
  console.log(model);
  console.log(variables);
  const [propmts, addPropts] = useState(usedPrompts);
  return <>
    <button onClick={()=>addPropts(propmts++)}></button>
  </>
}

DisplayPrompts.propTypes = {
}

const mapStateToProps = state => ({
});

export default DisplayPrompts;
